import styled from '@emotion/styled'
import calendar from './assets/calendar.svg'
import person from './assets/person.svg'
import book from './assets/book.svg'
import ruble from './assets/ruble.svg'
import ticket from './assets/ticket.svg'

const Nav = styled.nav`
  position: fixed;
  height: 100vh;
  width: 210px;
  left: 0px;
  top: 0px;
  background: #FFFFFF;
  margin: 0;
`
const Li = styled.li`
    list-style-type: none;
    display: block;
    margin-bottom: 13px;
    padding-left: 35px;
`

const A = styled.a`
    margin-left: 12px;
    text-decoration: none;
    font-family: Jost;
    font-style: normal;
    font-weight: normal;
    font-size: 13px;
    line-height: 19px;
    color: rgba(0, 0, 0, 0.5);
`


const Sidebar = () => (
    <div>
        <Nav>
            <Li><img src={calendar} /><A href="#">Занятия</A></Li>
            <Li><img src={person} /><A href="#">Учащиеся</A></Li>
            <Li><img src={book} /><A href="#">Тренеры</A></Li>
            <Li><img src={ruble} /><A href="#">Финансы</A></Li>
            <Li><img src={ticket} /><A href="#">Абонементы</A></Li>
            <Li><img src={person} /><A href="#">Доступ в CRM</A></Li>
            <Li><img src={person} /><A href="#">Рассылки</A></Li>
            <Li><img src={person} /><A href="#">Отчеты</A></Li>
            <Li><img src={person} /><A href="#">Настройки</A></Li>
        </Nav>
    </div>
)

export default Sidebar;
